import React from 'react';
import { Link } from 'react-router-dom';
import './design/Dashboard.css';

function Dashboard() {
  return (
    <div className="gradient-fluid-dashboard">
      {/* Gradient fluid background */}
      <div className="gradient-background">
        <div className="gradient-layer layer-1"></div>
        <div className="gradient-layer layer-2"></div>
        <div className="gradient-layer layer-3"></div>
        <div className="gradient-layer layer-4"></div>
      </div>
      
      {/* Content container */}
      <div className="dashboard-content">
        <div className="app-title">
          <h1>MoodMate</h1>
          <p>Your emotional wellness companion</p>
        </div>
        
        <div className="action-buttons">
          <Link to="/register" className="action-button register-btn">
            Register
          </Link>
          <Link to="/login" className="action-button login-btn">
            Login
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
